import React, { Component } from 'react';
import { Link } from 'react-router-dom'
import PropTypes from 'prop-types';
import { connect } from 'react-redux';
// import '../'

class CreateProfile extends Component {
    constructor(props) {
        super(props);
        this.state = {
            pet_name: '',
            pet_breed: '',
            pet_age: ''
        }
        this.handleInputChange = this.handleInputChange.bind(this);
    }

    componentDidMount() {
        if(!this.props.auth.isAuthenticated) {
            this.props.history.push('/login');
        }
    }

    handleInputChange(e) {
        this.setState({
            [e.target.name]: e.target.value
        })
    }

    addProfile() {
        console.log(this.state);
    }
    render() { 
        return ( 
            <div className="main-dasboard">
                <div className="container mt-5">
                    <div className="card dash-main-card">
                        <div className="card-header">
                            <label>Create Pet Profile</label>
                        </div>
                        <div className="card-body">
                            <div className="container">
                                <div className="row">
                                    <div className="col">
                                        <form>
                                            <div className="form-group col-md-6">
                                              <label>Pet Name</label>
                                              <input
                                                type="text"
                                                className="form-control"
                                                id="pet_name"
                                                placeholder="Pet Name"
                                                value={ this.state.pet_name }
                                                onChange={ this.handleInputChange }
                                              />
                                            </div>
                                            <div className="form-group col-md-6">
                                              <label>Pet Type</label>
                                                <select
                                                    id="pet_type"
                                                    className="form-control"
                                                    onChange={ this.handleInputChange }
                                                >
                                                  <option value="" selected>Pet Type</option>
                                                  <option value="dog">Dog</option>
                                                </select>
                                            </div>
                                            <div className="form-group col-md-6">
                                              <label>Pet Breed</label>
                                              <input
                                                type="text"
                                                className="form-control"
                                                id="pet_breed"
                                                placeholder="Pet Breed"
                                                value={ this.state.pet_breed }
                                                onChange={ this.handleInputChange }
                                              />
                                            </div>
                                            <div className="form-group col-md-6">
                                              <label>Age</label>
                                              <input
                                                type="text"
                                                className="form-control"
                                                id="pet_age"
                                                placeholder="Age"
                                                value={ this.state.pet_age }
                                                onChange={ this.handleInputChange }
                                              />
                                            </div>
                                            <button onclick="addProfile()" className="btn btn-primary">Next</button>
                                        </form>
                                    </div>
                                    <div className="col">

                                    </div>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            </div>

         );
    }
}

CreateProfile.propTypes = {
    auth: PropTypes.object.isRequired,
}

const mapStateToProps = (state) => ({
    auth: state.auth,
})

export  default connect(mapStateToProps)(CreateProfile)
